import React from 'react';
import ReactDOM from 'react-dom';
import { ChakraProvider, theme } from "@chakra-ui/react"
import Home from './Home';

ReactDOM.render(
  <React.StrictMode>
    <ChakraProvider theme={theme}>
    <Home />
    </ChakraProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
